import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ListNhanVien from "./components/listNhanVien";
import CreateNhanVien from "./components/createNhanVien";
import UpdateNhanVien from "./components/updateNhanVien";

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/" element={<ListNhanVien />} />
          <Route path="/create" element={<CreateNhanVien />} />
          <Route exact path="/detail/:id" element={DetailNhanVien} />
          <Route path="/update" element={<UpdateNhanVien />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
